@test integrate((a+b*tan(c+d*x))*(B*tan(c+d*x)+C*tan(c+d*x)^2)*cot(c+d*x), x) == :(x*(B*a+-1*C*b)+-1*d^-1*(B*b+C*a)*log(cos(c+d*x))+C*b*d^-1*tan(c+d*x))
